            dist = np.sqrt((troop.position[0])**2 + (troop.position[1])**2)
            # print("troop in arena dist", dist)
            opp_importance.append((troop_id[troop.name], 8*np.sqrt(max(troop.health,0))/(np.sqrt(max(dist,15))*np.sqrt(troop_maxhealth[troop.name]))
                                   ,troop.position[0], troop.position[1]))
           
