        if count != 1:
            new_imp = importance*np.sqrt(count/2)  
        if new_imp > threshold:
       
            input_NN[int(troop_id)] = new_imp
            input_NN[int(troop_id+1)] = x/25 + 1
            input_NN[int(troop_id+2)] = y/50   
